import React from "react";
import "./Toggler.css";

function Toggler({ toggle, dateItems }) {
  return (
    <div
      style={{
        display: toggle ? "flex" : "none",
      }}
      className="theToggler"
    >
      {dateItems.map((key, index) => {
        return (
          <div>
            {JSON.stringify(key.Date)}

            <div>
              {key.items.map((zac, index) => {
                return <div>{zac.text}</div>;
              })}
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Toggler;
